
CREATE TABLE `benefit` (
  `benefit_id` int NOT NULL,
  `medical` tinyint DEFAULT '0',
  `dental` tinyint DEFAULT '0',
  `vision` tinyint DEFAULT '0',
  `life` tinyint DEFAULT '0',
  `union_member` tinyint DEFAULT '0',
  `retirement` tinyint DEFAULT '0',
  `pet_insurance` tinyint DEFAULT '0',
  `employee_id` int NOT NULL,
  PRIMARY KEY (`benefit_id`)
);


